// styling
import "./index.scss";
// react depenedencies
import react from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
// importing pages
import LandingPage from "./pages/LandingPage";

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <LandingPage />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
